#
# TABLE STRUCTURE FOR: clickrcms_feedback
#

DROP TABLE IF EXISTS `clickrcms_feedback`;

CREATE TABLE `clickrcms_feedback` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '通知消息id',
  `subject` varchar(100) DEFAULT NULL COMMENT '主题',
  `name` varchar(100) DEFAULT NULL COMMENT '稱呼',
  `email` varchar(100) DEFAULT NULL COMMENT '反饋email',
  `phone` varchar(100) DEFAULT NULL COMMENT '反饋電話',
  `address` varchar(300) DEFAULT NULL COMMENT '聯絡地址',
  `status` tinyint(1) DEFAULT '1' COMMENT '狀態,1.未查看,2已查看',
  `content` text COMMENT '內容',
  `other_content` text COMMENT '其他內容資料',
  `updated_at` datetime NOT NULL COMMENT '更新時間',
  `created_at` datetime NOT NULL COMMENT '添加時間',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: clickrcms_language
#

DROP TABLE IF EXISTS `clickrcms_language`;

CREATE TABLE `clickrcms_language` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '語言表 id',
  `name` varchar(20) NOT NULL COMMENT '語言名字',
  `filename` varchar(20) DEFAULT NULL COMMENT '語言包名字',
  `code_path` varchar(20) DEFAULT NULL COMMENT '語言代碼',
  `sort_order` int(3) DEFAULT NULL COMMENT '排序',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '是否啟動 1 啟動,2禁止',
  `front_name` varchar(50) DEFAULT NULL COMMENT '前台名稱',
  `updated_at` datetime DEFAULT NULL COMMENT '更新時間',
  `created_at` datetime DEFAULT NULL COMMENT '新增時間',
  PRIMARY KEY (`id`),
  KEY `sort_order` (`sort_order`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_operator
#

DROP TABLE IF EXISTS `clickrcms_operator`;

CREATE TABLE `clickrcms_operator` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '操作日誌',
  `operator` varchar(50) NOT NULL COMMENT '操作人',
  `title` varchar(200) DEFAULT NULL COMMENT '標題',
  `action` varchar(50) DEFAULT NULL COMMENT '動作',
  `urls` varchar(200) DEFAULT NULL COMMENT 'url',
  `result` varchar(50) DEFAULT NULL COMMENT '操作結果',
  `updated_at` datetime DEFAULT NULL COMMENT '修改時間',
  `created_at` datetime NOT NULL COMMENT '添加時間',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=121 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_order
#

DROP TABLE IF EXISTS `clickrcms_order`;

CREATE TABLE `clickrcms_order` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '捐款id',
  `number` varchar(50) DEFAULT NULL COMMENT '訂單號',
  `donate_money` decimal(15,2) NOT NULL COMMENT '捐款金額',
  `donate_item` text NOT NULL COMMENT '捐款項目',
  `donate_item_other` varchar(300) DEFAULT NULL COMMENT '捐款項目其他',
  `donate_gender` varchar(100) NOT NULL COMMENT '捐款人稱呼',
  `donate_firstname` varchar(50) NOT NULL COMMENT '捐款人姓',
  `donate_lastname` varchar(50) NOT NULL COMMENT '捐款人名',
  `donate_email` varchar(100) NOT NULL COMMENT '聯絡電郵',
  `donate_country` varchar(100) NOT NULL COMMENT '捐款人國家/地區',
  `donate_phone` varchar(50) NOT NULL COMMENT '捐款人電話',
  `donate_address` varchar(300) DEFAULT NULL COMMENT '捐款人地址',
  `payment_method` varchar(50) NOT NULL COMMENT '支付方式',
  `need_receipt` tinyint(1) DEFAULT NULL COMMENT '需要捐款收據',
  `payment_receipt_type` tinyint(1) DEFAULT NULL COMMENT '收據寄送方式,1.電郵,2郵寄',
  `payment_receipt_note` varchar(300) DEFAULT NULL COMMENT '收據寄送補充',
  `need_subscribe` tinyint(1) DEFAULT NULL COMMENT '需要訂閱信息',
  `subscribe_type` tinyint(1) DEFAULT NULL COMMENT '訂閱信息方式,1電郵,2.郵寄,',
  `subscribe_note` varchar(300) DEFAULT NULL COMMENT '訂閱信息補充',
  `order_status_id` int(10) DEFAULT '0' COMMENT '捐款狀態.',
  `user_ip` varchar(100) DEFAULT NULL COMMENT '捐款人ip',
  `user_agent` varchar(350) DEFAULT NULL COMMENT '捐款人瀏覽器信息',
  `user_lang` varchar(100) DEFAULT NULL COMMENT '捐款人語言',
  `status` tinyint(1) DEFAULT '1' COMMENT '是否啟用,禁用',
  `updated_at` datetime NOT NULL COMMENT '更新時間',
  `created_at` datetime DEFAULT NULL COMMENT '創建時間',
  PRIMARY KEY (`id`),
  KEY `order_status_id` (`order_status_id`),
  KEY `status` (`status`),
  KEY `created_at` (`created_at`)
) ENGINE=InnoDB AUTO_INCREMENT=2127 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_page
#

DROP TABLE IF EXISTS `clickrcms_page`;

CREATE TABLE `clickrcms_page` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '頁面表id',
  `unique_url` varchar(20) NOT NULL COMMENT '唯一標示的靜態url',
  `sort_order` int(10) DEFAULT '0' COMMENT '排序',
  `view_num` int(10) DEFAULT '0' COMMENT '點擊量',
  `status` int(1) DEFAULT '1' COMMENT '狀態,1.顯示,2.不顯示',
  `parent_id` int(5) DEFAULT '1' COMMENT '默認類別,1.,2.會員區',
  `is_menu` int(1) DEFAULT '1' COMMENT '是否菜單顯示,1,不是,2是.',
  `main_image` varchar(150) DEFAULT NULL COMMENT '圖片Banner',
  `updated_at` datetime DEFAULT NULL COMMENT '修改日期',
  `created_at` datetime DEFAULT NULL COMMENT '新增日期',
  PRIMARY KEY (`id`),
  KEY `unique_url` (`unique_url`),
  KEY `sort_order` (`sort_order`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_page_description
#

DROP TABLE IF EXISTS `clickrcms_page_description`;

CREATE TABLE `clickrcms_page_description` (
  `page_id` int(10) NOT NULL COMMENT '頁面id',
  `language_id` int(10) NOT NULL COMMENT '對應語言id',
  `title` varchar(300) NOT NULL COMMENT '頁面標題',
  `introduction` varchar(500) DEFAULT NULL COMMENT '頁面簡介',
  `content` longtext COMMENT '頁面內容',
  PRIMARY KEY (`page_id`,`language_id`),
  KEY `title` (`title`(255))
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_payment
#

DROP TABLE IF EXISTS `clickrcms_payment`;

CREATE TABLE `clickrcms_payment` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '支付管理 id',
  `view_num` int(10) DEFAULT '0' COMMENT '瀏覽量',
  `sort_order` int(10) DEFAULT '0' COMMENT '排序',
  `status` int(1) DEFAULT '1' COMMENT '狀態 1 顯示,2不顯示',
  `main_image` varchar(100) DEFAULT NULL COMMENT '主圖片',
  `payment_key` varchar(50) DEFAULT NULL COMMENT '配置key',
  `updated_at` datetime DEFAULT NULL COMMENT '更新時間',
  `created_at` datetime DEFAULT NULL COMMENT '添加時間',
  PRIMARY KEY (`id`),
  KEY `sort_order` (`sort_order`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_payment_description
#

DROP TABLE IF EXISTS `clickrcms_payment_description`;

CREATE TABLE `clickrcms_payment_description` (
  `payment_id` int(10) NOT NULL COMMENT '支付管理id',
  `language_id` int(10) NOT NULL COMMENT '對應語言id',
  `title` varchar(150) NOT NULL COMMENT '支付管理標題',
  `introduction` varchar(200) DEFAULT NULL COMMENT '消息簡介',
  `content` text COMMENT '支付管理內容',
  PRIMARY KEY (`payment_id`,`language_id`),
  KEY `title` (`title`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_setting
#

DROP TABLE IF EXISTS `clickrcms_setting`;

CREATE TABLE `clickrcms_setting` (
  `setting_group` varchar(50) DEFAULT NULL COMMENT '設定組別',
  `setting_key` varchar(100) DEFAULT NULL COMMENT '網站關鍵字',
  `setting_value` text COMMENT '網站總描述',
  `description` varchar(300) DEFAULT NULL COMMENT 'key的描述',
  `status` int(1) DEFAULT '1' COMMENT '是否起用 1是,2否',
  `updated_at` datetime DEFAULT NULL COMMENT '更新時間',
  UNIQUE KEY `key` (`setting_key`),
  UNIQUE KEY `key_2` (`setting_key`),
  KEY `group` (`setting_group`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_slideshow
#

DROP TABLE IF EXISTS `clickrcms_slideshow`;

CREATE TABLE `clickrcms_slideshow` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '幻燈片 id',
  `main_image` varchar(200) DEFAULT NULL COMMENT '對應圖片',
  `support_mobile` tinyint(1) DEFAULT '1' COMMENT '支持手機版相片,1.不兼容,2兼容',
  `mobile_image` varchar(200) DEFAULT NULL COMMENT '手機版圖片',
  `sort_order` int(5) DEFAULT '0' COMMENT '排序',
  `target_link` varchar(200) DEFAULT NULL COMMENT '連接',
  `target_method` tinyint(1) DEFAULT '1' COMMENT '是否本窗口打開,1是,2不是',
  `page_controller` varchar(50) DEFAULT NULL COMMENT '對應頁面控制器',
  `page_position` varchar(50) DEFAULT NULL COMMENT '存在頁面的位置',
  `status` tinyint(1) DEFAULT '1' COMMENT '是否啟用',
  `updated_at` datetime DEFAULT NULL COMMENT '修改時間',
  `created_at` datetime DEFAULT NULL COMMENT '添加時間',
  PRIMARY KEY (`id`),
  KEY `sort_order` (`sort_order`),
  KEY `status` (`status`),
  KEY `page_controller` (`page_controller`),
  KEY `page_position` (`page_position`),
  KEY `support_mobile` (`support_mobile`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: clickrcms_slideshow_description
#

DROP TABLE IF EXISTS `clickrcms_slideshow_description`;

CREATE TABLE `clickrcms_slideshow_description` (
  `slideshow_id` int(10) NOT NULL COMMENT '幻燈片多語言id',
  `language_id` int(10) NOT NULL COMMENT '對應語言id',
  `title` varchar(200) NOT NULL COMMENT '幻燈片多語言標題',
  `introduction` varchar(300) DEFAULT NULL COMMENT '消息簡介',
  `content` text COMMENT '幻燈片多語言內容',
  PRIMARY KEY (`slideshow_id`,`language_id`),
  KEY `title` (`title`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: clickrcms_user
#

DROP TABLE IF EXISTS `clickrcms_user`;

CREATE TABLE `clickrcms_user` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '管理員表',
  `nickname` varchar(50) DEFAULT NULL COMMENT '稱呼',
  `login_name` varchar(50) DEFAULT NULL COMMENT '登入電郵',
  `login_pwd` varchar(100) DEFAULT NULL COMMENT '登入密碼',
  `token` varchar(100) DEFAULT NULL COMMENT 'token令牌 登入',
  `email` varchar(100) DEFAULT NULL COMMENT '聯絡電郵',
  `group_id` int(10) NOT NULL COMMENT '管理員組別',
  `pwd_verify_token` varchar(50) DEFAULT NULL COMMENT '修改密碼驗證code',
  `pwd_verify_time` int(10) DEFAULT NULL COMMENT '修改密碼鏈接時效',
  `status` int(1) DEFAULT '1' COMMENT '狀態1.啟用,2禁用.',
  `last_ip` varchar(50) DEFAULT NULL COMMENT '最後登入ip',
  `content` text COMMENT '內容',
  `updated_at` datetime DEFAULT NULL COMMENT '更新時間',
  `created_at` datetime DEFAULT NULL COMMENT '新增時間',
  PRIMARY KEY (`id`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_user_group
#

DROP TABLE IF EXISTS `clickrcms_user_group`;

CREATE TABLE `clickrcms_user_group` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '管理組id',
  `name` varchar(50) NOT NULL COMMENT '管理組名字',
  `permission` text COMMENT '管理權限',
  `created_at` datetime DEFAULT NULL COMMENT '修改時間',
  `updated_at` datetime DEFAULT NULL COMMENT '添加時間',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: clickrcms_visit
#

DROP TABLE IF EXISTS `clickrcms_visit`;

CREATE TABLE `clickrcms_visit` (
  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT '網站瀏覽訪問統計',
  `ip_address` varchar(20) NOT NULL COMMENT '訪問者IP地址',
  `offline_address` varchar(100) DEFAULT NULL COMMENT '線下地址',
  `visit_date` date DEFAULT NULL COMMENT '瀏覽日期',
  `source_url` varchar(300) DEFAULT NULL COMMENT '來源頁面',
  `visit_url` varchar(300) DEFAULT NULL COMMENT '瀏覽頁面',
  `device` enum('computer','mobile') DEFAULT NULL COMMENT '瀏覽設備',
  `user_agent` text COMMENT '用戶代理',
  `updated_at` datetime DEFAULT NULL COMMENT '編輯於',
  `created_at` datetime DEFAULT NULL COMMENT '創建於',
  PRIMARY KEY (`id`),
  KEY `ip_address` (`ip_address`),
  KEY `device` (`device`),
  KEY `visit_date` (`visit_date`),
  KEY `created_at` (`created_at`)
) ENGINE=InnoDB AUTO_INCREMENT=8734 DEFAULT CHARSET=utf8;



