INSERT INTO `clickrcms_page_description` (`page_id`, `language_id`, `title`, `introduction`, `content`) VALUES (1, 1, '備注', '備注', '<p>基督教宣道堂將運用您的個人資料作捐款收據及通訊之用，並使用香港伺服器儲存。</p><p>根據澳門個人資料保護法，您有權查閱、更正及要求刪除有關您的個人資料，請以書面形式通知基督教宣道堂。</p>');
INSERT INTO `clickrcms_page_description` (`page_id`, `language_id`, `title`, `introduction`, `content`) VALUES (1, 2, '备注', '备注', '<p>基督教宣道堂将运用您的个人资料作捐款收据及通讯之用，并使用香港伺服器储存。</p><p>根据澳门个人资料保护法，您有权查阅、更正及要求刪除有关您的个人资料，请以书面形式通知基督教宣道堂。</p>');
